create global temporary table temp_letter_subtype
( LETTER_FLEX_ID number(18,0) ,LETTER_REQ_ID number(18,0)) on commit preserve rows;


Update maxdat.D_PL_LETTER_SUBTYPE l
set letter_request_id = (select letter_req_id from temp_letter_subtype t where t.letter_flex_id = l.letter_flex_id)
where l.letter_request_id is null;


truncate table temp_letter_subtype;
drop table temp_letter_subtype;

commit;
